g2:c.PROCEDURE.g2:a.TEXT:
_ompe-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item named by devstuffName exists then
    insert _ompe-internals at the end of the item-list named by devstuffName;
  if the item named by intstuffName exists then
    insert _ompe-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

g2:c.METHOD.g2:a.TEXT:
_mpe-filter-block-action (BLK: class ompe-delete-message-block {the block to process}, REC: class ompe-string-receiver {the current thread of the block language}) = (class _mpe-filter-block {the next filter block to process})
{Creates an smh-message using attributes from the ompe-string-receiver and the ompe-create-message-block.}
ServerName: symbol;
smhMessageServerClassName: symbol = the symbol smh-message-server;
Server: class item;
Sender: class opfo-domain-object;
target: class opfo-domain-object;
CategoryToDelete: text = "";
Win: class item;
Options: text = "";
gevmMessageClass: class gevm-event-class;
Found: truth-value;
MessageQueue: class gevm-gqs-queue;
Timestamp: quantity = the current subsecond real time;
GevmEvent: class gevm-event;
EventClassName: symbol = the symbol gevm-message;
MPEEvents: sequence;
smhDeleteMessageProcName: symbol = the symbol smh-delete-message;
 
begin
    {Lookup the message server}
    ServerName = the ompe-message-server of Blk;

    {Find the target and sender domain objects}
    target = call devu-domain-object-lookup (the Ompe-target of REC);
    sender = call devu-domain-object-lookup (the ompe-sender of Rec);

    {Validate the category to delete}
    CategoryToDelete = the ompe-category-to-delete of Blk;
    if CategoryToDelete = "" then signal the symbol CATEGORY-REQUIRED, "In order to delete messages, you must provide a category in either the ompe-category-to-delete of the ompe-string-receiver or in the ompe-category of the ompe-create-message-block.";


    {get a usable window object}
    Win = call devu-safe-window ();

    if ServerName = the symbol ALL then Options = "-all";

    if gndo-does-module-exist (the symbol smh) and not (_use-gevm) then begin
      if (ServerName = the symbol all and there exists an item Server such that (Server is an instance of the class named by (smhMessageServerClassName))) or there exists an item Server named by ServerName then begin
          {Delete the message}
          if there exists a procedure Proc named by smhDeleteMessageProcName then begin
            start Proc (Server, Sender, Target, CategoryToDelete, Win, Options);
          end;
      end
      else signal the symbol NO-SUCH-MESSAGE-SERVER, "No Message Server named [ServerName] exists.  Either provide a valid Server Name or specify 'all' as the server name.";
    end else begin
      if ServerName /= the symbol ALL then begin
        Found, MessageQueue = call gevm-find-queue-by-key ("[ServerName]");
        if Found then begin
          MPEEvents = call gevm-get-collected-events-for-initiator-and-target (MessageQueue, Sender, Target, the symbol gevm-message, sequence (CategoryToDelete), sequence (), sequence ());
          call gevm-delete-events (MessageQueue, MPEEvents);
        end;
      end else begin
        for MessageQueue = each gevm-gqs-queue do
          MPEEvents = call gevm-get-collected-events-for-initiator-and-target (MessageQueue, Sender, Target, the symbol gevm-message, sequence (CategoryToDelete), sequence (), sequence());
          call gevm-delete-events (MessageQueue, MPEEvents);
        end;
      end;
    end;

    return the _mpe-filter-block connected at the output of BLK;
end

_mpe-filter-block-action (BLK: class ompe-create-message-block {the block to process}, REC: class ompe-string-receiver {the current thread of the block language}) = (class _mpe-filter-block {the next filter block to process})
{Creates an smh-message using attributes from the ompe-string-receiver and the ompe-create-message-block.}
ServerName: symbol;
smhMessageServerClassName: symbol = the symbol smh-message-server;
Server: class item;
Sender: class opfo-domain-object;
target: class opfo-domain-object;
Category: text = "";
TimeSent: integer;
ShowDisplay: truth-value = false;
Win: class item;
smhMessageClassName: symbol = the symbol smh-message;
Mess: class item;
gevmMessageClass: class gevm-event-class;
Found: truth-value;
MessageQueue: class gevm-gqs-queue;
Timestamp: quantity = the current subsecond real time;
GevmEvent: class gevm-event;
EventClassName: symbol = the symbol gevm-message;
smhCreateMessageProcName: symbol = the symbol smh-create-message;

begin
    {Lookup the message server}
    ServerName = the ompe-message-server of Blk;

    {Find the target and sender domain objects}
    target = call devu-domain-object-lookup (the Ompe-target of REC);
    sender = call devu-domain-object-lookup (the ompe-sender of Rec);

    {Calculate the category}
    if the ompe-category of rec /= "" then Category = the ompe-category of rec
    else Category = the ompe-category of Blk;

    {Validate the category}
    if Category = "" then signal the symbol CATEGORY-REQUIRED, "In order to create a message, you must provide a category in either the ompe-category of the ompe-string-receiver or in the ompe-category of the ompe-create-message-block.";
    {get a usable window object}
    Win = call devu-safe-window ();
    {Create the message}
    if gndo-does-module-exist (the symbol smh) and not (_use-gevm) then begin
      if there exists an item Server named by ServerName then begin
        if there exists a procedure Proc named by smhCreateMessageProcName then begin
          Mess = call Proc (Server, Sender, Target, Category, the ompe-message-text of Rec, the ompe-additional-text of Rec, -1.0, the ompe-priority of Blk, the ompe-lifetime of Blk, ShowDisplay, Win, the ompe-options of Blk);
        end;
      end else
         signal the symbol NO-SUCH-MESSAGE-SERVER, "No Message Server named [ServerName] exists.";
    end else begin
      Found, MessageQueue = call gevm-find-queue-by-key ("[the ompe-message-server of Blk]");
      if Found then begin
        if there exists a gevm-event-class gevmMessageClass such that (the name of gevmMessageClass exists and the name of gevmMessageClass = EventClassName) then begin
          GevmEvent = call gevm-create-event-and-insert-into-queue (gevmMessageClass, Category, the ompe-priority of Blk, the ompe-message-text of Rec, the ompe-additional-text of Rec, "" {Advice}, TRUE, "" {Comment}, Sender, Target, -1, TRUE {update duplicate}, MessageQueue, Timestamp, Win);
        end;
      end;
    end;

    return the _mpe-filter-block connected at the output of BLK;
end

_mpe-filter-block-action (BLK: class ompe-opac-subtask-start-block {the block to process}, REC: class ompe-string-receiver {the current thread of the block language}) = (class _mpe-filter-block {the next filter block to process})
{An ompe-call-opac-block starts the opac start task named by the ompe-opac-task-name.}
argList: class item-list;
OpacBlockName: symbol;
OpacBlock: class opac-syntax-element;
target: class opfo-domain-object;
Sender: class opfo-domain-object;
Window: class ui-client-item;
LocalArgumentAttributes: class value-list;
AttributeName: symbol;
TP: class text-parameter;
begin
    {Find the opac-subtask-start block}
    OpacBlockName = the ompe-opac-subtask-start-name of Blk;
    if there exists an opac-subtask-start OpacBlock named by OpacBlockName then begin
        {Get a safe window}
        WIndow = call devu-safe-window ();
        {Find the target and sender}
        target = call devu-domain-object-lookup (the ompe-target of REC);
        sender = call devu-domain-object-lookup (the ompe-sender of Rec);
        {Create Local Arguments}
        create an item-list argList;
        if the ompe-local-arguments of BLK /= "" then begin
            create a value-list LocalArgumentAttributes;
            call gfr-parse-string-into-value-list (the ompe-local-arguments of BLK, LocalArgumentAttributes, ",", Window);
            for AttributeName = each value in LocalArgumentAttributes do
                create a text-parameter TP;
                conclude that TP = the value that is an attribute of REC named by AttributeName;
                insert TP at the end of ArgList;
            end;
            delete LocalArgumentAttributes;
        end;
        {Start the subtask}
        start opac-start-task (OpacBlock, sender, target, Window, target, ArgList);
    end
    else signal the symbol NO-SUCH-OPAC-SUBTASK-START, "There is no Opac-Start-Task named [OpacBlockName] exists.";
    return the _mpe-filter-block connected at the output of BLK;
end
